import { useState } from 'react';
import './final.css';
import Nav from './Nav.js';

import Navbar from './Navbar';
import Introjust from './Introjust';


function Hero({lang, setLang, textLang}) {
    let [nav,setNav] = useState(false);
    let [sel, setSel] = useState(false);
  return (
     <div classname="nav-hero h-screen md:h-auto bg-first">
        <div classname="flex flex-col h-full ">

            <Navbar nav={nav} setNav={setNav} />
            <Introjust setSel lang={lang} setLang={setLang} textLang={textLang}/>

        </div>

        <Nav nav={nav} lang={lang} setLang={setLang} textLang={textLang}/>
    </div>
  );
}

export default Hero;
